import styles from "./Registration.module.scss";


import React, {useState} from 'react';

import {Link} from 'react-router-dom'; 
import axios from "axios";

function Registration() {
  //const [data, setData] = useState({});
  const [lastName, setLastName] = React.useState(``);
  const [name, setName] = React.useState(``);
  const [patronymic, setPatronymic] = React.useState(``);
  const [localityShipping, setLocalityShipping] = React.useState(``);
  const [email, setEmail] = React.useState(``);
  const [addressShipping, setAddressShipping] = React.useState(``);
  const [postcode, setPostcode] = React.useState(``);
  const [passwordHash, setPasswordHash] = React.useState(``);



  const handleSubmit = (event)=>{
    event.preventDefault();
    const data = new FormData();
    data.append("lastName",lastName);
    data.append("name",name);
    data.append("patronymic",patronymic);
    data.append("localityShipping",localityShipping);
    data.append("email",email);
    data.append("patronymic",patronymic);
    data.append("addressShipping",addressShipping);
    data.append("postcode",postcode);
    data.append("passwordHash",passwordHash);
    axios.post('http://localhost:4444/auth/register', data);
  };

  return (
    <div className={styles.content}>
      <h2>Регистрация</h2>
      <form onSubmit={handleSubmit}>
        <input
          class="text"
          type="text"
          name="lastName"
          placeholder="Фамилия"
          required=""

          onChange={(event)=>setLastName(event.target.value)}
        />
        <input
          class="text"
          type="text"
          name="name"
          placeholder="Имя"
          required=""

          onChange={(event)=>setName(event.target.value)}
        />
        <input
          class="text"
          type="text"
          name="patronymic"
          placeholder="Отчество (при наличии)"

          onChange={(event)=>setPatronymic(event.target.value)}
        />
        <input
          class="text"
          type="text"
          name="email"
          placeholder="Email"
          required=""

          onChange={(event)=>setEmail(event.target.value)}
        />
        <input
          class="text"
          type="text"
          name="localityShipping"
          placeholder="Город"
          required=""
          onChange={(event)=>setLocalityShipping(event.target.value)}
        />
        <input
          class="text"
          type="text"
          name="addressShipping"
          placeholder="Адрес"
          required=""
          value={addressShipping}
          onChange={(event)=>setAddressShipping(event.target.value)}
        />
        <input
          class="text"
          type="text"
          name="postcode"
          placeholder="Почтовый индекс"
          required=""
          onChange={(event)=>setPostcode(event.target.value)}
        />
        <input
          class="text"
          type="text"
          name="passwordHash"
          placeholder="Пароль"
          required=""
          onChange={(event)=>setPasswordHash(event.target.value)}
        />
         <div className={styles.buttons}>
        <button className={styles.orangeButton} type='submit'>Создать аккаунт</button>
        <Link to='/auth/login'> <button className={styles.yellowButton}> Войти</button></Link>
      </div>
      </form>

    </div>
  );
}
export default Registration;
